@-moz-document url-prefix("https://torrentgalaxy.to/torrents.php"), url-prefix("https://torrentgalaxy.to/torrent/") {
#inthpheader,#intblockheader,#panelheader,
#main > .row > div > div:first-child {display:none!important}
.col-lg-10 {
  width: 100%!important;
}
.hpcover {max-height:250px!important;height:250px!important}
#intblock{max-width:100% !important}

.hotlist{padding-right: 10px;padding-left: 10px;border:0px}


table.hotlist, tr.hotlist, td.hotlist{border: 0px!important}

nav.txlight {background: none}

#intblockslide {padding:20px}
#intblock {border:0px}

