div#panelmain > div.panel-body > div[style="padding-left:30px;padding-right:30px;"] {display: none}

legend {display:none}
.panel-primary[style="max-width:1111px;margin-bottom:10px;margin-top:10px;"] {display:none}
div#main > div.row > div > div > div#panelmain > div.panel-body > div#k1 {margin: 0px 27% !important;}
  

html body.txdark div#main div.row div.col-lg-12 div:nth-child(2) {float: unset;width: unset !important}
}
